Dog-fooding? → ./cells . Cells: this is no big monorepo, so ./cells only implements a single Cell : std . Organelles: std implements the cli , devshellProfiles , devshells & lib Organelle . Targets: cli , devshellProfiles & devshells each only implement a default Target . lib has more. Actions: some Targets have Actions derived from the Organelles . See ./flake.nix for the defined Organelles . Not all Clades implement Actions . { growOn, inputs, clades, harvest,
}:
growOn { inherit inputs; cellsFrom = ./cells; organelles = [ (clades.runnables "cli") (clades.functions "lib") (clades.functions "devshellProfiles") (clades.devshells "devshells") (clades.installables "packages") (clades.nixago "nixago") (clades.data "data") (clades.files "files") ];
} { devShells = harvest inputs.self ["automation" "devshells"]; packages = harvest inputs.self [["std" "cli"] ["std" "packages"]];
} That's it. std.grow is a "smart" importer of your nix code and is designed to keep boilerplate at bay. TIP: Now, enter the devshell (direnv allow) and play with the std CLI/TUI companion. It answers one critical question to newcomers and veterans alike: What can I do with this repository?

