Standard features a special project structure that brings some awesome innovation to this often overlooked (but important) part of your project. With the default Organelles , an apps.nix file tells Standard that we are creating an Application. flake.nix is in charge of explicitly defining the inputs of your project. ./flake.nix { inputs.std.url = "github:divnix/std"; inputs.nixpkgs.url = "nixpkgs"; outputs = {std, ...} @ inputs: std.grow { inherit inputs; cellsFrom = ./cells; };
} ./cells/hello/apps.nix { inputs, cell,
}: { default = inputs.nixpkgs.stdenv.mkDerivation rec { pname = "hello"; version = "2.10"; src = inputs.nixpkgs.fetchurl { url = "mirror://gnu/hello/${pname}-${version}.tar.gz"; sha256 = "0ssi1wpaf7plaswqqjwigppsg5fyh99vdlb9kzl7c9lng89ndq1i"; }; };
} $ cd hello-world
# fetch `std`
$ nix shell github:divnix/std
$ std //hello/apps/default:run
Hello, world! You see? from nothing to running your first application in just a few seconds ✨
